	///<summary>Provides Zmanim from a hard-coded array.</summary>
	///<remarks>This class has the OU Zmanim data for 2012 (a leap year after the DST change) hard-coded in the source.
	///It assumes that Zmanim do not change AT ALL across solar years.  I checked that for OU Zmanim between 2009 and 2037.</remarks>
	public class FixedZmanimProvider : ZmanimProvider {
		///<summary>Creates a new FixedZmanimProvider instance.</summary>
		protected FixedZmanimProvider() { }
		static FixedZmanimProvider defaultInstance = new FixedZmanimProvider();
		///<summary>Gets the FixedZmanimProvider instance.</summary>
		public new static FixedZmanimProvider Default { get { return defaultInstance; } }

		///<summary>Gets the first date that this instance can provide Zmanim for.</summary>
		public override DateTime MinDate { get { return DateTime.MinValue; } }
		///<summary>Gets the last date that this instance can provide Zmanim for.</summary>
		public override DateTime MaxDate { get { return DateTime.MaxValue; } }

		static readonly string[] zmanNames = Array.ConvertAll(Enum.GetValues(typeof(Zman)) as Zman[], e => ZmanimInfo.ToZmanName(e));

		///<summary>Gets the Zmanim for the given date.</summary>
		///<returns>A ZmanimInfo instance for date.</returns>
		public override ZmanimInfo GetZmanim(DateTime targetDate) { return new ZmanimInfo(targetDate, new ZmanimDict(targetDate, times[targetDate.DayOfYear - 1])); }

		class ZmanimDict : IDictionary<string, TimeSpan> {
			static readonly ReadOnlyCollection<string> names = new ReadOnlyCollection<string>(zmanNames);
			readonly ReadOnlyCollection<TimeSpan> times;
			public ZmanimDict(DateTime date, params TimeSpan[] times) {
				if (times.Length != names.Count) throw new ArgumentException("Wrong number of times", "times");
				//date = DateTime.SpecifyKind(date.Date, DateTimeKind.Utc);
				if (date.AddDays(1).IsDaylightSavingTime())
					this.times = new ReadOnlyCollection<TimeSpan>(Array.ConvertAll(times, t => t + TimeSpan.FromHours(1)));
				else
					this.times = new ReadOnlyCollection<TimeSpan>(times);
			}

			public int Count { get { return names.Count; } }
			public bool IsReadOnly { get { return true; } }
			public ICollection<string> Keys { get { return names; } }
			public ICollection<TimeSpan> Values { get { return times; } }


			public TimeSpan this[string key] {
				get { return times[names.IndexOf(key)]; }
				set { throw new NotSupportedException(); }
			}

			public IEnumerator<KeyValuePair<string, TimeSpan>> GetEnumerator() { for (int i = 0; i < Count; i++) yield return new KeyValuePair<string, TimeSpan>(names[i], times[i]); }
			System.Collections.IEnumerator System.Collections.IEnumerable.GetEnumerator() { return GetEnumerator(); }

			public bool ContainsKey(string key) { return names.Contains(key); }
			public bool Contains(KeyValuePair<string, TimeSpan> item) { return ContainsKey(item.Key) && this[item.Key] == item.Value; }
			public bool TryGetValue(string key, out TimeSpan value) {
				if (ContainsKey(key)) {
					value = this[key];
					return true;
				} else {
					value = default(TimeSpan);
					return false;
				}
			}

			public void Add(string key, TimeSpan value) { throw new NotSupportedException(); }
			public void Add(KeyValuePair<string, TimeSpan> item) { throw new NotSupportedException(); }
			public bool Remove(string key) { throw new NotSupportedException(); }
			public bool Remove(KeyValuePair<string, TimeSpan> item) { throw new NotSupportedException(); }
			public void Clear() { throw new NotSupportedException(); }

			public void CopyTo(KeyValuePair<string, TimeSpan>[] array, int arrayIndex) {
				if (array == null) throw new ArgumentNullException("array");

				foreach (var kvp in this)
					array[arrayIndex++] = kvp;
			}
		}

		///<summary>Creates a string of C# source containing the Zmanim for a solar year.</summary>
		///<param name="provider">A ZmanimProvider to read the Zmanim from.</param>
		///<param name="baseYear">The solar year to pass to the ZmanimProvider.</param>
		public static string GetDataString(ZmanimProvider provider, int baseYear) {
			if (provider == null) throw new ArgumentNullException("provider");

			var builder = new StringBuilder(0x1000000);
			if (!DateTime.IsLeapYear(baseYear)) throw new ArgumentException("FixedZmanimProvider must be based on a leap-year.", "baseYear");

			builder.AppendFormat(@"		#region Non-DST Times from {0} for {1}", provider, baseYear);
			builder.AppendLine();
			builder.AppendLine(@"		static readonly TimeSpan[][] times = { ");
			foreach (var zmanim in provider.GetZmanim(new DateTime(baseYear, 1, 1), new DateTime(baseYear, 12, 31))) {
				builder.Append(@"			new [] { ");
				for (int z = 0; z < zmanNames.Length; z++) {
					if (z > 0) builder.Append(", ");

					var time = zmanim[(Zman)z];
					//time = (date + time).ToUniversalTime().TimeOfDay;
					if (zmanim.Date.AddDays(1).IsDaylightSavingTime())
						time -= TimeSpan.FromHours(1);

					//If the Zman's precision is in seconds, write it nicely.
					if (time.Ticks == time.TotalSeconds * TimeSpan.FromSeconds(1).Ticks)
						builder.AppendFormat(CultureInfo.InvariantCulture, @"new TimeSpan({0:00}, {1:00}, {2:00})", time.Hours, time.Minutes, time.Seconds);
					else
						builder.AppendFormat(CultureInfo.InvariantCulture, @"TimeSpan.FromTicks({0})", time.Ticks);
				}
				builder.AppendLine(@" },");
			}
			builder.AppendLine(@"		};");
			builder.AppendLine(@"		#endregion");

			return builder.ToString();
		}
